import React from 'react';

const ProductosItem = ({ img, title, price, children }) => {
  return (
    <div className="product-card">
      <img src={img} alt={title} />
      <h3>{title}</h3>
      <p>Precio: $ {price}</p>
      <div className="product-description">
        {children}
      </div>
      <button className="add-to-cart-button">Agregar al carrito</button>
    </div>
  );
};

function ProductosPage() {
  // Aquí puedes agregar más productos utilizando ProductosItem
  return (
    <div>
      <h2>Catalogo de Productos</h2>

      <div className="products-container">
        {/* Elimina el espacio en blanco adicional en el siguiente div */}
        <div className="product-card">

          <ProductosItem
            img='https://crossfity.co/cdn/shop/products/CARBONO-3.0-NEGROM.jpg?v=1616804234'
            title='Calleras de carbono'
            price={900}
          >
            <p>Calleras de carbono, ideales para tus entrenamientos.</p>
          </ProductosItem>

          <ProductosItem
            img='https://m.media-amazon.com/images/I/71MpXqTQQKL._AC_UF894,1000_QL80_.jpg'
            title='Rodillera elastizada'
            price={1200}
          >
            <p>Calleras de carbono, ideales para tus entrenamientos.</p>
          </ProductosItem>

          <ProductosItem
            img='https://i5.walmartimages.com.mx/mg/gm/3pp/asr/604846da-5363-4d1b-80b5-ac477763f326.d6b7d688dd891f1d85ed9607acbe3450.jpeg?odnHeight=612&odnWidth=612&odnBg=FFFFFF'
            title='Cuerda de saltar'
            price={600}
          ></ProductosItem>

          <ProductosItem
            img='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTQHUoYln5NDPCBcAuOouFPYCevf4ATuHL9XA&usqp=CAU'
            title='Muñequera elastica'
            price={700}
          ></ProductosItem>
        </div>
      </div>
    </div>
  );
}

export default ProductosPage;
